import React from 'react';
import { FaGithub, FaLinkedin } from 'react-icons/fa';

const SocialLinks = () => {

    const links = [
        {
            id:1,
            child:(
                <>
                LinkedIn<FaLinkedin size={30}/>
                </>
            ),
            href: 'https://www.linkedin.com/in/vijay-a-ba3886259/',
            style: 'rounded-tr-md'
        },

        {
            id:2,
            child:(
                <>
                Github<FaGithub size={30}/>
                </>
            ),
            href: 'https://github.com/Vijay-Hozo',
        },

        {
            id:3,
            child:(
                <>
                Mail<HiOutlineMail size={30}/>
                </>
            ),
            href: 'vijay2304a@gmail.com',
            style:'rounded-'
        },
    ]

  return (
    <div className='flex-col top-[35%] left-0 fixed'>
        <ul>
            <li className='flex justify-between items-center w-40 h-14 px-4 ml-[-100px] bg-gray-500 hover:ml-[-10px] hover:rounded-md duration-300'>
                <a href="" className='flex justify-between items-center w-full text-white'>
                    <>
                    LinkedIn<FaLinkedin size={30}/>
                    </>
                </a>
            </li>
        </ul>
    </div>
  )
}

export default SocialLinks
